import {Fragment} from 'react';

import styles from './Header.module.css';

const Header = props => {
    return (
        <Fragment>
            <header>
                <div className="logo-container">
                    <img src="img/logo.jpg" className="logo" alt="logo"/>
                </div>
            </header>
        </Fragment>
    )
};

export default Header;
